	function get-userinfo
	{
		Param
		(
			[Parameter(Mandatory = $true, Position = 0)]
			[string]$val
		)
		
		
		$getone = (([adsisearcher]"(&(objectCategory=User)($searchby=$val))").FindOne())
		$getad = $getone.properties
		
		$Login = $loginmask.Text = $getad.samaccountname
		$Lastname = $getad.sn
		$Office = $getad.physicaldeliveryofficename
		$displayname = $getad.givenname
		$employeeid = $getad.employeeid
		$add = $getad.whencreated
		$Ou = $null
		
		($getad.distinguishedname -split ",") | ForEach-Object {
			
			if ($_ -match 'OU=*')
			{
				
				
				$Ou += $_ + ','
				
			}
			
		}
		$state = [bool]($getone.getdirectoryentry().userAccountControl[0] -band 2)
		$service = $getad.department
		$description = $getad.description
		$fonction = $getad.title
		$ville = $getad.l
			
		if ($state -eq $false)
		{
			$colors1 = 'green'
			$enabled = $xmldata.action.Activer.InnerText
		}
		else
		{
			$colors1 = 'red'
			$enabled = $xmldata.action.Desactiver.InnerText
			
		}
		
		
		$passlastchange = [datetime]::fromfiletime($getad.pwdlastset[0])
		$lastlogondate = [datetime]::fromfiletime($getad.lastlogon[0])
		
		$mail = $getad.mail
		$mobilephone = $getad.telephonenumber
			
		
		$richtextbox1.Clear()
		$richtextbox1.AppendText($xmldata.action.login.InnerText + ": " + "$Login" + "`r`n" + "`r`n" + $xmldata.action.prenom.InnerText + ": " + "$displayname" + "`r`n" + "`r`n" + $xmldata.action.name.InnerText + ": " + "$Lastname" + "`r`n" + "`r`n" + $xmldata.action.employID.InnerText + ": " + "$employeeid" + "`r`n" + "`r`n")
		$richtextbox1.AppendText($xmldata.action.createdaccount.InnerText + " : " + $add + "`r`n" + "`r`n" + $xmldata.action.lastlogondate.InnerText + ": " + "$lastlogondate" + "`r`n" + "`r`n" + $xmldata.action.passlastchange.InnerText + ": " + "$passlastchange" + "`r`n" + "`r`n" + $xmldata.action.email.InnerText + " : " + "$mail" + "`r`n" + "`r`n" + $xmldata.action.phone.InnerText + ": " + "$mobilephone" + "`r`n" + "`r`n")
		$richtextbox1.SelectionColor = $colors1
		$richtextbox1.AppendText($xmldata.action.accountis.InnerText + "$enabled" + "`r`n" + "`r`n")
		if ($getad.lockouttime -ge '1')
		{
			$lock = $xmldata.action.locked.InnerText
			$richtextbox1.SelectionColor = 'red'
			$richtextbox1.AppendText($lock + "`r`n" + "`r`n")
		}
		$richtextbox1.AppendText($xmldata.action.office.InnerText + ": " + "$Office" + "`r`n" + "`r`n" + "OU : " + "$ou" + "`r`n" + "`r`n")
		$richtextbox1.AppendText($xmldata.action.service.InnerText + ": " + "$service" + "`r`n" + "`r`n" + $xmldata.action.description.InnerText + " : " + "$description" + "`r`n" + "`r`n")
		$richtextbox1.AppendText($xmldata.action.fonction.InnerText + ": " + "$fonction" + "`r`n" + "`r`n" + $xmldata.action.ville.InnerText + " : " + "$ville" + "`r`n" + "`r`n")
	}
	
