	$Create_Click={
		#TODO: Place custom script here
		
		#$PWD = Read-Host "Enter Le nouveau mot de passe" -AsSecureString	
		# departement = service, description = desciprtion, title = fonction,
		#physicaloffice = bureau $message = $xmldata.action.desactivercompte.InnerText + $selectcomputer
		
		if (!$firstname.Text -or !$lastname.Text)
		{
			[System.Windows.Forms.MessageBox]::Show($xmldata.action.champsobligatoire.InnerText)
		}
		else
		{
			
			$name = $firstname.Text + ' ' + $lastname.Text
			$HashArguments = @{
				Name			 = $name
				SamAccountName   = $SamAccountName.Text
				GivenName	     = $firstname.Text
				Surname		     = $lastname.Text
				EmailAddress	 = $textbox11.Text
				UserPrincipalName = $SamAccountName.Text + $upn.Text
				AccountPassword  = Read-Host -Prompt $xmldata.action.enterpass.InnerText -AsSecureString 
				Enabled		     = $true
				description	     = $desc.Text
				displayname	     = $display.Text
				EmployeeID 		 = $EmployeID.Text
				department	     = $Service.Text
				title		     = $Fonction.Text
				City		     = $ville.Text
				office		     = $office.Text
				OfficePhone	      = $phone.Text
				PasswordNeverExpires = $checkboxPassNeverExpired.Checked
				CannotChangePassword = $checkboxCannotChangePass.Checked
				ChangePasswordAtLogon = $checkboxChangePassAtLogon.Checked
			}
			
			if ($OU.Text)
			{
				new-aduser @HashArguments -Path $OU.Text -ErrorVariable pascreer -ErrorAction Stop
			}
			else
			{
				new-aduser @HashArguments -ErrorVariable pascreer -ErrorAction Stop
			}
			
			if ($pascreer)
			{
				
				[System.Windows.Forms.MessageBox]::Show($pascreer)
			}
			else
			{
				[System.Windows.Forms.MessageBox]::Show('user created')
			}
		}
	}
	
