	$buttonpass_Click={
		#TODO: Place custom script here
		$compte1 = $loginmask.Text
		$message = $xmldata.action.changepass.InnerText + $compte1
		$message1 = $xmldata.action.changepass1.InnerText
		
		$result = [System.Windows.Forms.MessageBox]::show($message, 'Validate', 'OKCancel')
		if ($result -eq "ok")
		{
			
			$PWD = Read-Host $message1 -AsSecureString
			
			Set-ADAccountPassword -Identity $compte1 -Reset -NewPassword ($pwd) -ErrorAction stop -ErrorVariable noparametre
			
			if (!$noparametre)
			{
				[System.Windows.Forms.MessageBox]::Show($xmldata.action.passisok.InnerText)
			}
			else
			{
					[System.Windows.Forms.MessageBox]::Show($noparametre.message)
			
			}
			
		}
	}
	
